let state = {
  posts: [
    {'id':'1', 'message':'Hi,how are you?', 'likesCount': 22},
    {'id':'2', 'message':'It\'s my first post', 'likesCount': 15}
  ],
  dialogs: [
    {'id':1, 'name': 'Dima'},
    {'id':2, 'name': 'Roof'},
    {'id':3, 'name': 'Andry'},
    {'id':4, 'name': 'Roma'}
  ],
  messages: [
    {'id':1, 'message': 'Hi'},
    {'id':2, 'message': 'How are you?'},
    {'id':3, 'message': 'Yo'},
    {'id':4, 'message': 'Yo'}
  ]
}

export default state;
